import {Col, Form} from 'react-bootstrap'
import { Checkbox } from 'pretty-checkbox-react';

class SubScriptionControl extends Component {
    constructor(props) {
        super(props);
        this.state = {
            files: [],
            imageUrls: [],
            videoUrls: [],
            type: 'image',
            socialMediaList: this.props.socialMediaList,
            platforms: ['facebook', 'instagram', 'linkedin', 'twitter', 'google', 'youtube', 'angellist', 'codepen', 'envelope', 'etsy', 'flickr', 'foursquare', 'github-alt', 'github', 'gitlab', 'medium', 'pinterest', 'quora', 'reddit-alien', 'soundcloud', 'stack-overflow', 'steam', 'stumbleupon', 'tumblr', 'twitch', 'google-plus-official', 'vimeo', 'vk', 'weibo', 'wordpress', 'other'],
            selectedPlatform: '',
            socialMediaLink:'',
            icon:'',

        };

    }


    render() {


        return (
            <div>
                <div>
                    <h2>Subscription Control</h2>
                </div>

                <Form.Group>
                    <Form.Label>
                        Add Social Media
                    </Form.Label>
                    <Form.Row>

                        <Form.Group as={Col} className={'center'}>
                            <input type="checkbox" />
                        </Form.Group>
                    </Form.Row>


                </Form.Group>



            </div>
        )
    }


}

export default SubScriptionControl;
